import React from 'react';
import ReactMarkdown from 'react-markdown';

const MaestroEvaluation = ({ evaluation, isLoading }) => {
  if (isLoading) {
    return (
      <div className="p-6 bg-white rounded-lg shadow-md">
        <div className="flex items-center justify-center">
          <svg className="animate-spin h-8 w-8 text-primary-500 mr-3" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
            <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
            <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
          </svg>
          <span className="text-lg font-medium text-gray-700">Maestro is evaluating the model responses...</span>
        </div>
      </div>
    );
  }

  if (!evaluation) {
    return null;
  }

  return (
    <div className="p-6 bg-white rounded-lg shadow-md">
      <div className="mb-6 flex items-center">
        <img 
          src="https://via.placeholder.com/40?text=AI21" 
          alt="AI21 Maestro" 
          className="h-10 w-10 rounded-full mr-3"
        />
        <div>
          <h3 className="text-xl font-semibold text-gray-900">Maestro Evaluation</h3>
          <p className="text-sm text-gray-500">
            Objective analysis by AI21's Maestro
          </p>
        </div>
      </div>

      <div className="prose max-w-none">
        <ReactMarkdown>
          {evaluation}
        </ReactMarkdown>
      </div>

      <div className="mt-6 pt-4 border-t border-gray-200">
        <p className="text-xs text-gray-500 italic">
          This evaluation was generated by AI21's Maestro, which objectively analyzes model outputs.
          Scores and rankings are specific to this particular prompt and may vary for different tasks.
        </p>
      </div>
    </div>
  );
};

export default MaestroEvaluation;
